INSERT INTO `wisata` (`id_wisata`, `nama_wisata`, `alamat_wisata`, `detail`, `foto`, `lat`, `lng`) VALUES
(3, 'Parangtritis', 'Parangtritis, Kretek, Bantul', '<p>Parangtritis merupakan objek wisata yang cukup terkenal di Yogyakarta selain objek pantai lainnya seperti Samas, Baron, Kukup, Krakal dan Glagah. Parangtritis mempunyai keunikan pemandangan yang tidak terdapat pada objek wisata lainnya yaitu selain ombak yang besar juga adanya gunung-gunung pasir di sekitar pantai, yang biasa disebut gumuk.&nbsp;</p>\r\n\r\n<p>Waktu berkunjung paling pas ke pantai parantritis adalah pada sore hari. Bukan tanpa alasan, kamu bisa melihat sunset nan indah. Dari tempat ini dan kamu juga bisa memotret keindahan sunset yang membentang luas dilangit selatan. Selain itu, jika kamu kesini bersama keluarga di siang atau pagi hari, kamu bisa bermain pasir, bermain ATV, naik andong, maraton dan serlfi.</p>\r\n\r\n<p>Untuk kamu yang suka berpetualang, kamu wajib mencoba ATV, dengan 50.000 sampai 100.000 rupiah kamu bisa dengan bebas menerjang air bibir pantai dengan puas. Selain itu kamu juga bisa bermanufer dengan teman di bagian ujung pantai selatan yang sepi pengunjung.</p>\r\n\r\n<p>Di pantai parangtritis juga tersedia vila dan hotel dan harganya lumayan murah. Untuk sekelas penginapan harga dibandrol mulai dari 25.000 permalam dan untuk villa serta hotel harga mulai dari 300 ribu sampai dengan 2 juta rupiah.</p>\r\n\r\n<p>Jika kamu berkesempatan berwisata di pantai selatan ini, kamu wajib untuk mengunjungi candi gembirawati. Jarak dari pantai ke candi gembirawati sekitar 100 sampai 200 meter yang bisa kamu tempuh dengan sepeda motor dan berjalan kaki untuk memanjat tebingnya. Sesampai diatas kamu tidak hanya menemukan candi gembirawati tapi kamu juga akan melihat laut lepas pantai selatan yang membentang sejauh mata memandang.</p>\r\n\r\n<p>Untuk kamu yang ingin masuk kewiasta pantai ini akan dikenakan tarif sebesar 5000 per orangnya dan biaya parkir untuk kendaraan bermotor 2000 rupiah saja. Cukup murah bukan?</p>\r\n\r\n<p>Untuk jam operasional pantai ini mulai dari jam 7 pagi sampai dengan jam 5 sore. Namun tidak sedikit para wisatawan yang memilih berkunjung dimalam hari untuk menikmati gemuruh ombak yang syahdu. Tapi perlu di ingat, jika berkunjung dimalang hari harus tetap berhati hati. Karena mitos atau benar fakta memang tempat dipercaya sebagai gerbang ke alam goib. Datanglah dengan tujuan positif agar wisatamu lebih berharga dan menyenangkan.</p>\r\n', '1_3.jpg', '-8.0085846', '110.2923277'),
(4, 'Gumuk Pasir Parangkusumo', 'Jl. Pantai Parangkusumo, Pantai, Parangtritis, Kec. Kretek, Bantul, Daerah Istimewa Yogyakarta 55772', '<p>Gumuk pasir di Pantai Parangkusumo ini merupakan jenis langka yang hanya dapat ditemukan di sebagian kecil tempat di seluruh dunia. Berada di sini seolah membuatmu sedang di area padang pasir di Afrika. Dengan ketinggian 5 hingga 15 meter, gumuk pasir di sini bisa dijadikan tempat sandboarding. Berlokasi di antara Pantai Parangtritis dan Pantai Depok Yogyakarta, tepatnya berada di Jl. Pantai Parangkusumo, Parangtritis, Kecamatan Kretek, Kabupaten Bantul, Yogyakarta.&nbsp; Tempat ini merupakan gurun pasirnya kota Yogya.</p>\r\n\r\n<p>Banyak sekali kegiatan menarik yang dapat dilakukan di Gumuk Pasir Parangkusumo Yogyakarta. Salah satunya adalah aktivitas&nbsp;<em>Sandboarding&nbsp;</em>atau Ski pasir yang dikelola oleh pemuda-pemuda setempat.</p>\r\n\r\n<p>Ski pasir di gumuk pasir Parangkusumo ini menjadi kegiatan favorit turis local maupun mancanegara. Untuk dapt menikmati ski pasir ini, wistawan akan dkenakan baiaya sewa peralatan yang menyeruapi&nbsp;<em>Skateboard&nbsp;</em>seharga Rp 150.000 sampai dengan Rp 200.000.</p>\r\n\r\n<p>Peralatan tersebut sangat mirip sekali dengan papan&nbsp;<em>Skateboard.&nbsp;</em>Yang membedakan adalah papan ski pasir ini tidak memiliki roda, hanya saja dibagian bawah papan ski ini dilapisi dengan lilin sehingga akan memperlancar papan ketika digunakan untuk meluncur.</p>\r\n\r\n<p>Tak perlu takut untuk mencoba olahraga unik satu ini. Pemuda setempat yang mengelola&nbsp;<em>Sandboarding&nbsp;</em>ini akan mengajari semua pengunjung dengan baik. Untuk pengunjung yang belum pernah mencoba ski pasir ini, pemandu akan mengajak ke daerah perbukitan yang tidak erlalu tinggi.</p>\r\n\r\n<p>Selain untuk kegiatan&nbsp;<em>sandboarding,</em>gumuk pasir Parangkusumo Yogyakarta juga menjadi salah satu tempat menarik untuk para fotografer. Biasanya banyak sekali pasangan-pasangan muda yang akan menikah melakukan foto&nbsp;<em>prewedding&nbsp;</em>di lokasi ini.</p>\r\n\r\n<p>Hasil fotonya pun sangat unik. Seolah-olah meraka sedang berada di tengah Gurun Sahara. Warga setempat juga telah menghias Gumuk Pasir tersebut dengan baik, salah satu wujud nyatanya adalah dengan adanya sepasang ayunan yang berada diatas bukit yang tidak terlalu tinggi.</p>\r\n\r\n<p>Selain itu terdapat juga spot foto yangada pohon kaktusnya, lalu terdapat juga beberapa spot foto hasil kreativitas pengurus lokasi wisata ini, yaitu sebuah rangkaian bunga berbentuk hati dan juga sebuah gambar kupu-kupu besar yang dibuat dari tutup-tutup botol minuman yang dibuang.</p>\r\n\r\n<p><strong>Fasilitas yang ada di Gumuk Pasir Parangkusumo Yogyakarta</strong></p>\r\n\r\n<p>Fasilitas yang terdapat di gumuk pasir Parangkusumo Yogyakarta juga cukup lengkap. Mulai dari tempat parker yang luas, tempat beribadah, dan juga toilet sudah disediakan oleh pengelola. Sehingga pengunjung tidak perlu bingung untuk mencari fasilitas tersebut.</p>\r\n\r\n<p>Dan juga,di sekitar lokasi Gumuk Pasir Parangkusumo juga terdapat beberapa pedagang yang menjajakan makanan serta minuman kecil. Sehingga ketika pengunjung sudah mulai lelah, haus dan lapar, pengunjung dapat menikmatai makanan-makanan ringan tersebut sebagai pengganjal perut.</p>\r\n', '1_4.jpg', '-8.022769', '110.3228063'),
(5, 'Pantai Goa Cemara', 'Jl. Lintas Sel., Patihan, Gadingsari, Sanden, Bantul, Daerah Istimewa Yogyakarta 55763', '<p>Pantai Goa Cemara Kab Bantul terletak di provinsi Yogyakarta, Indonesia. Tepatnya di&nbsp;<strong>Jalan Lintas Selatan, Patihan, Gadingsari, Sanden, Bantul, Daerah Istimewa Yogyakarta 55763</strong>. Terdapat 42 tempat wisata di Kab Bantul. Jika anda ingin mendapatkan petunjuk arah ke tempat wisata tersebut, silakan klik tombol petunjuk arah di bawah untuk membuka peta navigasi. Di peta navigasi tersebut, terdapat pilihan apakah memakai kendaraan umum, jalan kaki, atau pakai mobil.</p>\r\n\r\n<p>Berbeda dengan wisata pantai lain di Bantul yang mungkin sudah cukup kamu kenal, kamu bisa menemui satu spot foto yang sangat instagramworthy di Pantai Goa Cemara. Spot foto yang dimaksud adalah jajaran pohon cemara berderet yang seolah membentuk lorong atau goa.&nbsp;</p>\r\n\r\n<p>Umumnya, harga tiket untuk masuk tempat wisata berbeda antara hari libur, minggu atau hari biasa. Berikut kami sertakan daftar harga tiket masuk ke area Kab Bantul. Harga bisa berubah sewaktu-waktu.</p>\r\n\r\n<p>Saat weekday, harga tiket masuk Pantai Goa Cemara adalah&nbsp;<strong>Rp5,000.00</strong>. Sementara saat weekend, harga tiket masuk Pantai Goa Cemara adalah&nbsp;<strong>Rp5,000.00</strong>. Ada baiknya konfirmasi harga lewat call center di bawah. Harga weekday umumnya berarti hari Senin-Jumat, sementara weekend Sabtu dan Minggu.</p>\r\n\r\n<p>Daya tarik lainnya Pantai Goa Cemara adalah keberadaan Mercusuar setinggi 40 meter yang bisa dimasuki oleh pengunjung. Mercusuar ini juga menjadi spot favorit bagi wisatawan yang berkunjung ke Pantai Goa Cemara.</p>\r\n\r\n<p>Bagi wisatawan yang ingin masuk dan naik ke atas mercusuar akan dikenakan biaya Rp 5.000 untuk 2 orang. Tapi saat banyak pengunjung yang ingin naik, Anda harus antre yah! Karena untuk sekali masuk ke dalam mercusuar hanya dibatasi 2 orang saja.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1_5.jpg', '-7.999423', '110.2467743'),
(6, ' Kebun Bunga Celosia', 'Ngasemayu, Salam, Patuk, Gunung Kidul Regency, Special Region of Yogyakarta 55862', '<p>Setelah viralnya hamparan bunga amarylis, hamparan bunga enceng gondok, bunga tebu, bunga matahari, sekarang ada lagi yang sedang ngetren di dunia pariwisata kekinian yaitu hamparan bunga celosia yang berada di Gunungkidul. Hamparan Bunga Celosia ini berlokasi di Padukuhan Nglaos, Desa Kemadang, Kecamatan Tanjungsari. Lokasi ini hanya berjarak 200 meter dari Pantai Kukup, taman ini sudah menjadi lokasi wisata dan spot selfie baru yang telah diramaikan pengunjung beberapa hari belakangan.</p>\r\n\r\n<p>Hamparan Bunga Celosia ini menjadi viral di media sosial karena tempat ini sangat indah dan tergolong romantis dengan hamparan pemandangan ribuan bunga Celosia yang tertata rapi dan berwarna-warni. Bisa dibayangkan tentunya sensasi berselfie atau wefie bersama pasangan atau rombongan, dengan latar belakang bunga warna-warni. Deretan foto selfie di Taman Bunga Celosia sendiri saat ini sudah banyak bertebaran di medsos.</p>\r\n\r\n<p>Bunga yang bernama latin Celosia Plumosa itu memang terkenal sebagai salah satu bunga pengungkap cinta karena warnanya yang cerah dan indah. Pemilik Taman Bunga Celosia, awalnya Eko Handayanto mengatakan bahwa taman ini sebetulnya belum rencana dibuka untuk umum. Nantinya, ia baru akan membuka lokasi indah tersebut pada saat hari raya lebaran. Namun melihat antusiasme pengunjung yang besar, akhirnya membuat pemilik membukanya untuk umum sejak satu minggu yang lalu.</p>\r\n\r\n<p>Untuk tarif berfoto di taman bunga yang ia kembangkan dikenai tarif Rp 5 ribu sudah dengan parkirnyaUntuk retribusi masuk pantai biasanya Rp 10.000,- . Untuk menuju taman bunga celosia pun tidaklah susah. Anda dapat mengambil akses menuju obyek Pantai Sepanjang. Nah, taman itu terletak di sebelah selatan jalan dan nampak jelas ketika terlihat dari jalanan. Taman bunga Celosia ini memiliki ribuan bunga yang terhampar indah. Selain menyediakan tempat untuk berselfi, pengunjung juga dapat membeli bunga celosia dengan harga Rp 20 ribu.</p>\r\n', '1_6.jpg', '-7.9982504', '110.2724093'),
(7, 'Kebun Bunga Matahari', 'Jalan Lintas Selatan, Srigading, Sanden, Trukan, Srigading, Sanden, Bantul, Daerah Istimewa Yogyakarta 55763', '<p>Terletak di kawasan Bantul, Jogjakarta, Kebun Bunga Matahari Jogja ini menjadi viral di media sosial terutama di Instagram. Tepatnya, lokasinya berada di Desa Srigading, Kecamatan Sanden, Kabupaten Bantul Jogjakarta. Lokasinya akan mudah ditemui karena warga sekitar sendiri mengetahui lokasi wisata populer ini.</p>\r\n\r\n<p>Cara mencapai lokasinya, anda tinggal menuju ke arah Bantul hingga melewati kota dan carilah jalan Samas. Setelah ada di Jalan Samas, ambil jalan lurus menuju ke arah Samas Beach hingga melewati TPR dan kemudian pilih hingga menemukan persimpangan jalan JLS yang kemudian piih jalan kanan atau arah barat. Dalam jarak 500 meter saja, anda bisa melihat kondisi.</p>\r\n\r\n<p>Bunga matahari di sini awalnya ditanam sebagai penahan angin dari lahan pertanian cabai milik warga setempat, namun tidak disangka ternyata ketika mekar banyak orang tertarik untuk berhenti di pinggir jalan dan kemudian berfoto dengan bunga matahari yang sedang bermekaran. Kini, banyak warga sekitar yang mulai menanam bunga matahari untuk bisa dinikmati para wisatawan. Cukup dengan 5,000 IDR, kamu bisa berfoto sepuasnya di sini. Tapi ingat, jangan sampai memetik bunga apalagi merusak area tanamannya ya!</p>\r\n\r\n<p>Sebagai tips, karena memang berbeda dengan lokasi wisata lainnya atau bisa dibilang bawa lokasi ini spesial untuk berfoto maka akan lebih baik lagi apabila anda datang di pagi hari atau di sore hari. pasalnya, lokasi dari Kebun Bunga Matahari Jogja ini memang dekat dengan pantai dan agar mendapatkan foto yang terbaik.</p>\r\n\r\n<p>Yang kedua, datanglah di hari kerja atau selain akhir pekan. Karena seperti yang kita ketahui jika Kebun Bunga Matahari Jogja ini sangat populer di media sosial yang didominasi oleh anak muda sehingga hari biasa akan sepi oleh pengunjung. Dampaknya adalah foto anda akan menjadi lebih baik karena tidak akan ada pengunjung lain terlihat.</p>\r\n', '1_7.jpg', '-7.9984134', '110.2598676'),
(8, 'Pintu Langit Dahromo', 'Jalan Dahromo Karang Asem, Karang Asem, Muntuk, Dlingo, Bantul, Daerah Istimewa Yogyakarta 55783', '<p>Dinamakan pintu langit karena di lokasi ini terdapat spot foto dengan sebuah pintu yang seolah merupakan gerbang masuk menuju langit. Pokoknya dijamin sangat instagramworthy deh!&nbsp;Berada di deretan bukit-bukit yang membentang indah di tenggara Bantul, Bukit Dahromo ikut meramaikan wisata di Mangunan dengan beberapa spot foto yang asik banget. Bukit Lintang Sewu dengan spot berbentuk bintang maupun rumah Indian sudah lebih dulu dikenal oleh publik. Ada lagi spot-spot unyu seperti bunga matahari maupun kupu-kupu di&nbsp;<a href=\"https://www.hipwee.com/travel/bukit-mojo-gumelem-destinasi-baru-yang-instagrammable-di-bantul-surga-bagi-pecinta-selfie/\">Bukit Mojo</a>. Kini hadir Pintoe Langit yang bikin&nbsp;<em>traveler</em>&nbsp;penasaran karena saking indahnya.</p>\r\n\r\n<p>Sebenarnya kamu bisa datang saja untuk berfoto di sana. Entah pagi, siang ataupun malam hari yang berkilauan cahaya kota. Namun memang waktu terbaik untuk mengunjungi pintu langit adalah saat terbitnya matahari di pagi hari.&nbsp;Kalau kamu nggak pengen foto dengan spot pintu ini, tenang masih ada beberapa spot foto lain yang bisa kamu coba. Ada spot berbentuk rumah berwarna putih dengan beberapa tanaman. Ada juga spot berbentuk jendela yang digantungkan ke ranting-ranting kayu. Masih banyak yang lainnya kok. Hanya saja orang lebih suka berfoto di pintu langit.</p>\r\n\r\n<p>Untuk bisa menikmati foto&nbsp;dengan spot Pintu Langit, pengunjung cukup membayar tiket masuk yang relatif terjangkau. Harga tiket masuk Pintu Langit Dahromo ini hanya Rp 5.000/orang dan biaya parkir Rp 2.000/motor. Cukup murah bukan? Yaudah kalau murah segeralah datang ke Pintu Langit Bukit Dahromo di Dlingo, Bantul.</p>\r\n', '1_8.jpg', '-7.913608', '110.4355943'),
(10, 'Sendang Ngembel', 'Dusun Beji Wetan, Desa Sendangsari, Kecamatan Pajangan, Beji Wetan, Sendangsari, Kec. Bantul, Bantul, Daerah Istimewa Yogyakarta 55751', '<p>Sebagian besar pasokan air berasal dari Sendang Ngembel. Apalagi di sekitar sendang merupakan tanah berkapur yang relatif kering. Menurut sumber setempat, Sendang Ngembel ini tidak pernah kering meskipun pada saat musim kemarau. Sendang yang merupakan mata air alami ini ketika kami singgahi masih terlihat sangat asri tanpa adanya dinding beton yang mengelilingi area sendang tersebut. Sendang ini di kelilingi oleh pohon-pohon yang relatif tinggi. Sendang Ngembel dikenal juga dengan nama Sendang Beji, nama Beji tersebut digunakan untuk menamakai dusun dimana sendang ini berada. nama Sendang Ngembel sendiri ada sejarahnya, dinamakan Sendang Ngembel karena ketika ditemukan air sendang ini keruh bercampur lumpur.</p>\r\n\r\n<p>Sendang ini masih dipergunakan sebagai penyuplai aliran irigasi bagi lahan pertanian penduduk setempat hal ini diperkuat adanya pintu air yang berada disisi selatan-barat yang berfungsi mengatur aliran tersebut. Kondisi saat ini air yang ada tidak seperti saat ditemukan namun airnya berwarna hijau karena adanya lumut didasar sendang. Yang menjadi sendang ini kelihatan eksotis adalah adanya bangunan ditengah sendang dengan luas sekitar 2,5 x 2,5 meter. Bangunan ini lebih mirip sebagai altar penyembahan yakni berupa meja batu kecil dengan dikelilingi 3 pohon cemara sedangkan penghubung antara pinggir sendang dengan bangunan ditengah sendang tersebut berupa jalan setapak.</p>\r\n\r\n<p>Pada tanggal 15 bulan besar pada penanggalan jawa selalu diadakan syukuran di sendang tersebut hal ini sebagai ucapan syukur atas air yang melimpah yang dapat mengaliri persawahan mereka. Syukuran tersebut ditandai dengan kenduri dengan sajian berupa Nasi tumpeng.</p>\r\n\r\n<p>Adapun fasilitas yang disediakan yaitu Mushola, warung makan, gazebo dan tempat parkir</p>\r\n', '1_10.jpg', '-7.886054', '110.292266'),
(11, 'Curug Banyunibo', 'Dusun Kabrukan Kulon, Desa Sendangsari, Pajangan, Bantul, YogyakartaÂ ', '<p>Objek Wisata Air Terjun Banyunibo di Pajangan Bantul Yogyakarta memiliki pesona keindahan yang sangat menarik untuk dikunjungi. Sangat di sayangkan jika anda berada di kota Bantul tidak mengunjungi Objek Wisata Air Terjun Banyunibo di Pajangan Bantul Yogyakarta yang mempunyai keindahan yang tiada duanya tersebut.</p>\r\n\r\n<p>Berada di kawasan hutan yang asri dan cukup tersembunyi, air terjun ini memiliki ukuran yang tidak terlalu tinggi, yakni sekitar 10 meter dengan banyaknya aliran air yang mengalir ke bawah sehingga sangat apik dipandang, terutama ketika musim penghujan tiba. Air curug sangat jernih dan alirannya tidak begitu deras, sehingga pengunjung dapat bermain air dengan aman di bawah air terjun. Pilihan terbaik adalah menggunakan kendaraan pribadi. Selain itu Anda juga harus siap untuk menaklukkan jalan khas pegunungan yang naik turun. Dari tempat parkir yang disediakan Anda perlu berjalan kaki untuk menuju ke kawasan Curug Banyunibo. Air terjun di sini mengalirkan air yang sangat jernih. Debit air di kawasan wisata ini akan melimpah saat musim hujan tiba.</p>\r\n\r\n<p>Kapanpun Anda berencana ke sini, jangan lupa untuk memakai alas kaki dengan sol antiselip. Meski terkesan sepele hal ini diperlukan untuk meminimalisir resiko terpeleset karena bebatuan di sekitar air terjun yang licin. Umumnya selain menikmati sejuknya pemandangan alam di sini, ada pula pengunjung yang memanfaatkan air terjun untuk mandi atau berenang.</p>\r\n\r\n<p>Tidak ada biaya masuk untuk berkunjung ke sini.&nbsp;Anda hanya perlu membayar biaya parkir saja.</p>\r\n\r\n<p><strong>Adapun fasilitas yang disediakan</strong>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Penyewaan Ban Renang</li>\r\n	<li>Gazebo</li>\r\n	<li>Tempat parkir.</li>\r\n</ul>\r\n', '1_11.jpg', '-7.87542', '110.28757'),
(12, 'Makam Sewu', 'DesaÂ Wijirejo,Â Kecamatan Pandak, Kabupaten Bantul, Daerah Istimewa Yogyakarta, Indonesia.', '<p>Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta adalah salah satu tempat wisata yang berada di Desa Wijirejo, Kecamatan Pandak, Kabupaten Bantul, Daerah Istimewa Yogyakarta, Indonesia. Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta adalah tempat wisata yang ramai dengan wisatawan pada hari biasa maupun hari liburan.</p>\r\n\r\n<p>Tempat ini sangat indah dan bisa memberikan sensasi yang berbeda dengan aktivitas kita sehari hari. Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta memiliki pesona keindahan yang sangat menarik untuk dikunjungi. Sangat di sayangkan jika anda berada di kota Bantul tidak mengunjungi Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta yang mempunyai keindahan yang tiada duanya tersebut.</p>\r\n\r\n<p>Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta ini memiliki Tradisi yang telah mengakar kuat ini dihelat menjelang Ramadan. Tujuannya, untuk mendoakan para leluhur. Juga, seluruh anggota keluarga yang telah berpulang. Tradisi Nyadranan di kompleks Makam Sewu berbeda dengan ritual serupa di daerah lain. Sejak se-puluh tahun lalu, ada rangkaian acara lain melengkapi tradisi ini. Yakni, kirab budaya. Ada gunungan dan jodhangan yang diarak dalam kirab yang mengam-bil start dari Kantor Kelurahan Wijirejo, dan finis di kompleks Makam Sewu ini. Isi gunungan berupa berbagai hasil bumi. Itu mengandung pesan sebagai ungkapan rasa syukur kepada Tuhan Yang Maha Esa. Adapun jodhangan berisi jajanan berupa ketan, kolak, dan apem.</p>\r\n\r\n<p>Fasilitas Objek Wisata Makam Sewu di Pandak Bantul Yogyakarta bisa dibilang sebuah wisata Ziarah yang memiliki beberapa akan fasilitas dan pelayanan di antaranya sebagai berikut :</p>\r\n\r\n<ul>\r\n	<li>Area Parkir kendaraan</li>\r\n	<li>Mushola</li>\r\n	<li>Kamar mandi / MCK -</li>\r\n	<li>Tempat Istirahat</li>\r\n	<li>warung makan</li>\r\n	<li>dan masih banyak lainya</li>\r\n</ul>\r\n', '1_12.jpg', '-7.894800', '110.293461'),
(13, 'Goa Selarong', 'dusun Kembang Putihan desa Gowasari, Kecamatan Pajangan, Kabupaten Bantul, Yogyakarta.', '<p>Goa Selarong adalah tempat di mana perjuangan Pangeran Diponegoro berpusat, yang menjadi markas gerilya dalam peperangan melawan penjajahan Belanda. Oleh karena itu, Goa Selarong menjadi salah satu tempat wisata di Jogja yang menarik untuk di kunjungi. Bagi sebagian orang, goa ini masih memiliki nilai mistik dan mengandung misteri. Inilah sebabnya mengapa Goa Selarong menjadi sebuah tempat yang erat kaitannya dengan hal-hal religius. Salah satu objek wisata Jogja ini juga memiliki acara tahunan yang dikenal sebagai Grebeg Goa Selarong. Acara ini adalah untuk mengenang hijrahnya Pangeran Diponegoro ke Goa Selarong. Hari hijrah Pangeran Diponegoro ini juga telah dijadikan sebagai peringatan hari jadi Kabupaten Bantul.</p>\r\n\r\n<p>Untuk dapat tiba di mulut Goa Selarong, Anda harus menaiki anak tangga yang curam dengan tingkat kemiringan 45 derajat. Begitu tiba puncak tangga, ada dua buah goa kecil di sebelah kanan dan kiri tangga. Sebelah kanan tangga bernama Goa Putri. Goa ini dulu adalah tempat beristirahat Raden Ayu Ratnaningsih, istri Pangeran Diponegoro.</p>\r\n\r\n<p>Di sebelah kiri tangga adalah goa yang dinamakan Goa Kakung.Goa ini merupakan tempat istirahat Pangeran Diponegoro. Dua buah goa ini berukuran kecil, dengan tinggi dan kedalaman goa sekitar 1,5 meter.</p>\r\n\r\n<p>Lebar Goa Putri lebih panjang daripada Goa Kakung, yaitu sekitar tiga meter dan Goa Kakung hanya memiliki lebar sekitar dua meter. Dari pelataran goa ini, Anda dapat melihat pemandangan sekitar serta air terjun yang berada tak jauh dari Goa Selarong tersebut.</p>\r\n\r\n<p>Untuk dapat menikmati wisata di&nbsp;<strong>Goa Selarong</strong>, Anda dapat membayar tiket masuk sebesar Rp 2 ribu per orang. Jika membawa kendaraan, maka Anda juga harus membayar biaya parkir. Fasilitas publik yang tersedia di tempat wisata Goa Selarong di antaranya adalah toilet umum, tempat ibadah, sarana bermain, gardu pandang, pendopo untuk beristirahat, dan bahkan dapat dijadikan sebagai bumi perkemahan jika Anda suka.</p>\r\n', '1_13.jpg', '-7.861964', '110.314867'),
(14, 'Kars Tubing Sedayu Yogyakarta', 'Jalan WatesÂ Km 9 Surobayan, Sedayu, Bantul', '<p>Salah satu tempat wisata baru yang menjadi rujukan wisata di Yogyakarta adalah Karst Tubing. Obyek wisata susur sungai ini baru dibuka 5 Juni 2016 lalu. Lokasinya di Jalan Wates&nbsp;Km 9 Surobayan, Sedayu, Bantul.</p>\r\n\r\n<p>Karst Tubing menawarkan wisata menyelusuri&nbsp;Sungai Konteng menggunakan ban sejauh 1 kilometer. Wisata ini dinamai Karst Tubing karena batuan di sepanjang sungai yang dilewati batuannya jenis karst. Hanya 12 KM dari pusat kota Jogjakarta, atau perjalanan kurang dari 30 menit saja; Anda bisa menikmati serunya wisata di KARST TUBING. Wahana sungai alam dengan bentangan dinding batuan Karst, arus sungai deras serta rimbunnya vegetasi pepohonan besar di sepanjang sungai akan memberikan pengalaman tersendiri.</p>\r\n\r\n<p><strong>TRACK DOMESTIC FOREIGNER DURATION</strong></p>\r\n\r\n<ul>\r\n	<li>TRACK 1 IDR. 40.000 IDR. 60.000 900 Meters - 30 Minutes</li>\r\n	<li>TRACK 2 IDR. 50.000 IDR. 70.000 1.400 Meters - 45 Minutes</li>\r\n</ul>\r\n\r\n<p>Sudah termasuk : Alat keselamatan: helm, live jacket, sepatu, Pemandu, kendaraan setelah selesai, Coffee Break jajanan tradisional, asuransi. Biaya potografes dan videographer sebesar Rp. 75.000,-</p>\r\n\r\n<p><strong>Fasilitas Umum</strong></p>\r\n\r\n<ul>\r\n	<li>Kantin</li>\r\n	<li>Mushola</li>\r\n	<li>Toilet</li>\r\n	<li>Arena</li>\r\n	<li>Taman permainan anak serta panggung terbuka</li>\r\n	<li>Tempat Parkir</li>\r\n</ul>\r\n', '1_14.jpg', '-7.813907', '110.27533'),
(15, 'Goa Payaman ', 'Kepuhan,Argorejo,Sedayu, Kabupaten Bantul, Daerah Istimewa Yogyakarta 55752', '<p>Goa payaman&nbsp;terletak di Kepuhan RT.11, Argorejo, Sedayu, Bantul,Yogyakarta sekitar 14 Km dari kota Yogyakarta. Dari jalan raya yogya wates km 12 tepatnya diperempatan sedayu kearah selatan kurang lebih 1,5 km melalui jalan sedayu gesikan, sarana dan prasarana jalan sudah cukup memadai dan dapat dilalui oleh kendaraan roda 4, truck dan bus. Lokasi Goa Payaman terletak di kawasan Desa Wisata Payaman dimana memiliki daya tarik wisata berupa wisata alam dan lokasi perkemahan. Mudahnya lokasinya berada di tepi jalan Sedayu-Pajangan dari jalan Raya Jogja-Wates.</p>\r\n\r\n<p>Kendaraan dapat diparkirkanr di&nbsp;bumi perkemahan dilanjutkan dengan berjalan kaki melalui jalan setapak menuju Goa Payaman. Saat tiba di Goa Payaman, bentuk goa hanya sedalam 8 meter dan tidak terlihat adanya stalaktit dan stalakmitnya. Dengan ukuran panjang dan lebar sekitar 8 meter bisa diperkirakan goa tersebut berfungsi sebagai tempat tinggal.</p>\r\n\r\n<p>Dahulu Goa Payaman ada dua buah yaitu Goa Lanang dan Goa Putri, namun saat ini hanya tersisa Goa Putri karena Goa Lanang sudah tertutup tanah. Keberadaan nama Goa Lanang dan Goa Putri mengingatkan kami terhadap nama goa yang hampir sama di Kraton Ratu Boko. Banyak cerita, sejarah, dan mitos yang berkembang di kawasan Goa Payaman dari masa ke masa. Cerita Goa Lanang yang sudah ditutup diantaranya sebagai tempat pertapaan Prabu Brawijaya V dan tempat keluar masuknya Nyi roro Kidul dari Laut Selatan. Sedangkan Goa Putri sebagai tempat beristirahat Prabu Brawijaya V dan Raden Panekti serta pada era perang melawan penjajah digunakan sebagai tempat bersembunyi sementara Pangeran Diponegoro dari kejarah tentara Belanda. Keberadaan cerita mistis didi Goa Payaman menyebabkan goa ini jarang dikunjungi dan efek baiknya adalah tidak ditemukan corat-coret di dinding goa. Sepertinya semua kawasan wisata akan terlihat alami dan bersih kalau banyak terdapat cerita dan mitos yang berkembang.</p>\r\n\r\n<p>Tidak jauh dari tempat ini oleh masyrakat sekitar difungsikan sebagai bumi perkemahan yang dikelola oleh Payaman management karena bumi perkemahan ini sepenuhnya tanah milik warga sendiri. Hal ini diharapkan dapat memaksimalkan potensi wisata payaman yang ada dilingkungan tersebut. Luas bumi perkemahan tersebut seluas 2 Ha dengan fasilitas 2000 tanah perkemahan, aula 2 buah, dengan ukuran masing masing 6&times;8 dan 4&times;6,&nbsp;kemudian mushola, MCK 12 ruang, panampungan air bersih 3 buah, listrik, keamanan, parkir. Selain itu ada juga fasilitas untuk permainan yakni tali tambang 40 meter, egrang dan teklek. Karena keterbatasan anggaran&nbsp; pihak penggelola belum dapat menyediakan banyak permainan.</p>\r\n\r\n<p>Selain sebagai tempat perkemahan tempat ini juga asik sebagai tempat outbond dan hiking, karena letaknya yang sedikit diatas daerah sekitarnya yakni pada ketinggian 110 diatas permukaan laut dengan pepohonan yang rindang memiliki panorama yang indah dan sayang untuk dilewatkan. Untuk kegiatan Hiking jarak yang biasa ditempuh sejauh 5 kilo meter, 10 Kilo meter, dan 15 kilo meter dengan membayar tariff sebesar Rp. 5.000,-, sedangkan untuk mempergunakan bumi perkemahan perorang dikenai biaya Rp. 10.000,- hinggga Rp. 12.000,- per orang per 3 hari.</p>\r\n', '1_15.gif', '-7.821647', '110.254392'),
(16, 'Kebun Buah Sedayu', 'Jl. Argorejo, Sundi Kidul, Argorejo, Sedayu, Bantul, Daerah Istimewa Yogyakarta 55752', '<p>Lokasi Kebun buah dari&nbsp; Perempatan Sedayu ke selatan atau arah Wisma Maria&nbsp;sekitar satu kilometer. Sebelum wisma tersebut, di bagian kanan jalan akan terpampang penunjuk arah menuju Kebun Buah Sedayu. Kebun yang baru dibuka Januari tahun ini adalah milik dari Bapak Ardi Nugroho Bonaventura, seorang yang gemar mengoleksi tanaman langka. Seiring waktu, koleksinya semakin banyak mulai dari tanaman langka dari dalam negeri hingga luar negeri.&nbsp;</p>\r\n\r\n<p>Wisata Agro Edukatif Kebun Buah Langka Sedayu yang terletak di Jalan Wates km 12 Dusun Sundi Kidul, Kel. Argorejo, Kec.Sedayu, Kab. Bantul Yogyakarta. Disini Anda akan disuguhi aneka tanaman buah langka yang berasal dari Indonesia dan luar negeri. Kebun ini mempunyai koleksi sekitar 300 buah tanaman langka seperti Anggur Brasil Basil (Jaboticaba), Buah Tin, Blackberry, Kacang Amazon, Jeruk Nagami dan masih banyak yang lainnya. Untuk fasilitas yang ada disini meliputi tempat parkir, mushola, dan Joglo yang berada di tengah-tengah kebun.</p>\r\n\r\n<p>Harga tiketnya cukup murah meriah, hanya 10 ribu rupiah per orang. Jam buka mulai pukul 09.00 &ndash; 16.00 WIB. Yuk, ajak keluarga dan buah hati Anda kesini untuk mengenal berbagai macam buah-buahan langka.</p>\r\n', '1_16.png', '-7.834395', '110.258633'),
(17, 'Memorial HM Jendral Soerharto', 'Dusun Kemusuk, Jl. Nulis - Puluhan, Srontakan, Argomulyo, Sedayu, Bantul, Daerah Istimewa Yogyakarta 55752', '<p>Museum memorial Jenderal Besar Soeharto diresmikan bertepatan dengan hari lahir beliau 08 Juni di Dusun Kemusuk, Desa Argomulyo, Kecamatan Sedayu, Bantul, DIY. Di atas lahan seluas 3.620 meter persegi, museum ini didirikan untuk mengenang jasa dan pengabdian beliau semasa hidupnya untuk bangsa Indonesia. Di museum ini juga memajang berbagai prestasi yang diraih beliau semasa menjabat Presiden RI ke-2. Museum memorial Jenderal Besar Soeharto ini dibangun dan diresmikan oleh Bapak H. Probosutedjo (adik dari Soeharto) dan Mbak Tutut (putri pertama Soeharto) terdiri dari beberapa bangunan utama seperti pendopo, ruang diorama dan masjid kecil di sebelah selatan persis ruang diorama ini.</p>\r\n\r\n<p>Dalam kunjungannya di museum ini, redaksi kotajogja.com sempat melakukan wawancara singkat dengan Aryo Winoto keponakan dari Bp Soeharto. Memorial ini dibangun menjadi tetenger dan sumber inspirasi bagi generasi muda, selain itu untuk mengenang jasa dan pengabdian beliau kepada bangsa negara Republik Indonesia. Memasuki museum ini kita akan disambut dengan patung besar Jenderal Besar HM. Soeharto karya seniman Edhi Sunarso bersebelahan dengan batu besar sebagai prasasti peresmian museum.</p>\r\n\r\n<p>Setelah itu kita masuk dalam pendopo yang memajang multimedia perjuangan beliau serta buku elektronik yang bersebelahan dengan patuh setengah badan Soeharto. Untuk melihat koleksi lengkap dari museum ini, pengunjung dapat memasuki ruang diorama yang dikemas dengan perpaduan tradisional dan modern. Memasuki ruangan ini, pengunjung akan disambut dengan instalasi roll film yang berisi dokumentasi visual gerak tentang perjuangan beliau, selain itu kita akan disugsuhi diorama perjuangan beliau ketika melakukan koordinasi dengan Pangsar Jenderal Sudirman ketika SO 1 Maret 1949. Di dalam diorama ini kita juga bisa melihat ketika beliau diundang oleh FAO di Roma tahun 1985 untuk mendapatkan penghargaan keberhasilan beliau dalam melakukan swasembada pangan</p>\r\n\r\n<p>Tiket gratis pengunjung, kecuali parkir kendaraan dikenakan tarif. Terdapat pendopo untuk menyaksikan audio visual kilas balik kehidupan pak Harto. Ada ruang diorama dan petilasan sumur rumah asli orang tua pak Harto. Bila beruntung, berkesempatan mendapatkan buku tentang latar belakang dan kisah pak Harto dari masa ke masa.</p>\r\n', '1_17.png', '-7.818874', '110.255245'),
(18, 'Puncak Bucu', 'Ngelosari, Srimulyo, Piyungan, Ngayang, Sitimulyo, Piyungan, Bantul, Daerah Istimewa Yogyakarta 55792', '<p>Bukit&nbsp;Bucu terletak di Desa Ngelosari, Kecamatan Piyungan, Kabupaten Bantul yang letaknya tidak terlalu jauh dari Bukit Bintang. Bukit Bucu hanyalah sebuah bukit yang tidak terlalu tinggi dan terdiri dari bebatuan yang besar. Sekilas Bukit Bucu tampak seperti Gunung Api Purba Nglanggeran. Dari atas puncak bukit ini kita bisa melihat pemandangan desa yang ada di bawahnya serta bukit-bukit lain yang ada di kawasan ini. Yang menjadi daya tarik utama dari Bukit Bucu ini adalah indahnya sunset yang bisa kita lihat pada sore hari. Matahari yang hendak tenggelam dan mulai berubah warna bisa kita tangkap dengan jelas menggunakan mata kita di atas Bukit Bucu.</p>\r\n\r\n<p>Jika ingin menikmati keindahan matahari terbenam tersebut, usahakan datang sebelum pukul 17.30. Karena pada waktu-waktu tersebut matahari sudah mulai berubah dan menuju ke peraduannya. Selain sunset, pesona lain yang ditawarkan Bukit Bucu adalah kerlap-kerlip lampu yang bisa kita saksikan pada malam hari. Akses menuju ke Bukit Bucu terbilang cukup beragam. Mulai dari jalanan aspal yang halus, jalanan yang hanya dibeton pada kedua sisinya sampai jalanan yang berbatu. Tidak terlalu banyak petunjuk yang bisa kita dapatkan untuk menuju ke Bukit Bucu, cara termudah untuk mencari petunjuk adalah dengan bertanya kepada penduduk sekitar.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1_18.jpg', '-7.86199', '110.44315'),
(19, 'Bukit Lintang sewu', 'Karang Asem, Muntuk, Dlingo, Bantul Regency, Special Region of Yogyakarta 55783', '<p>Tempat wisata yang dibangun Januari 2016 ini memang belum se popular tempat wisata di samping-sampingnya seperti Hutan Pinus, Kebun Buah Mangunan dan Puncak Becici. Bukit ini Dulunya terkenal dengan nama bukit Watu Asah-asah. Penamaan Bukit Lintang Sewu karena pada malam hari terlihat lampu kota dan apabila cuaca cerah kalian bisa melihat beribu bintang.</p>\r\n\r\n<p>Beberapa Hal menarik bisa ditemukan diantaranya:</p>\r\n\r\n<ol>\r\n	<li>Menarik untuk foto waktu senja (sunset) dan malam hari Terdapat 3 spot foto yang menarik,yaitu : Tugu Watu Asah sebagai ikon lintang sewu, Gardu Pandang Bambu di sebelah timur dan Tapak Butho di sebelah barat</li>\r\n	<li>Tempat yang luas untuk camping.</li>\r\n</ol>\r\n\r\n<p>untuk harga tiketnya relatif murah</p>\r\n\r\n<ul>\r\n	<li>Tiket @Rp.2000</li>\r\n	<li>Parkir motor Rp.2.000</li>\r\n	<li>Parkir mobil Rp.5.000</li>\r\n	<li>Parkir Bis Rp.20.000.</li>\r\n</ul>\r\n\r\n<p><strong>Buka setiap hari pukul 06.00 - 18.00 WIB. </strong></p>\r\n\r\n<p>Fasilitas yang ditawarkan yakni Parkir Spot foto, Camping Ground, Foto untuk Preweding, Gazebo untuk beristirahat, Toilet, dan Warung makan (buka waktu liburan)</p>\r\n', '1_19.jpg', '-7.914692', '110.435752'),
(20, 'Air terjun Randu sari', 'Jl. Randusari, Banyuurip, Jatimulyo, Dlingo, Bantul, Daerah Istimewa Yogyakarta 55783', '<p>Wisata ini menawarkan Air Terjun yang masih alami dan di bawah pepohonan yang rindang. Selain kita bisa menikmati indahnya Air Terjun Randusari Dlingo Bantul ini kita juga bisa menikmati udara bersih lingkungan alam yang hijau royo-royo beserta udara yang sangat sejuk.</p>\r\n\r\n<p>Wisata Air Terjun Randusari ini terletak di dusun Rejosari, desa Jatimulyo, kecamatan Dlingo, kabupaten Bantul. Air Terjun Randusari ini terletak di sekitaran pepohonan yang rindang, sekilas air terjun ini seolah seperti dua air terjun yang berdampingan. Karena di aliran air terjun tersebut ada batu pemisah sehingga mengakibatkan seolah air terjun ini kembar. Nama Air Terjun Randusari ini berasal dari pohon yang berada di lokasi, pohon tersebut bernama pohon randu atau pohon kapuk yang oleh masyarakat biasanya di gunakan untuk isian kasur dan bantal. Sumber mata air Air Terjun Randusari ini berasal dari mata air ngreboh yang sebenarnya mata air ini untuk memenuhi kebutuhan pengairan warga setempat. Mata air Ngreboh ini sebenarnya tidak pernah mengering walau saat musim kemarau namun hanya cukup untuk memenuhi kebutuhan masyarakat saja. Jadi banyak yang mengatakan Air Terjun Randusari ini kala musim kemarau akan mengering atau berkurang airnya.</p>\r\n\r\n<p>Ciri khas dari Air Terjun Randusari ini yang membuat beda dengan air terjun lainnya yakni mempunyai air terjun kembar dan di sekeliling air terjun terdapat pepohonan yang rindang seperti pohon kelapa berjajar sehingga bisa di fungsikan sebagai Hammock dan bisa bersantai sambil melihat Air Terjun. https://www.gunungkidulku.com/2017/02/rute-menuju-air-terjun-randusari-dlingo.html</p>\r\n', '1_20.jpg', '-7.918070', '110.490150'),
(21, 'Jembatan Soka', 'Soko, Seloharjo, Pundong, Bantul Regency, Special Region of Yogyakarta 55771', '<p><strong>Jembatan soka</strong> berada di atas aliran sungai yang menambah keindahan saat di foto. Namun, saat musim hujan aliran sungainya mungkin lebih deras. Untuk itu, sebaiknya kamu kesini pas cuaca cerah, jadinya lebih aman untuk foto-foto. Yang menarik dari Jembatan soka adalah pemandangan hijau yang bagus untuk dijadikan latar belakang foto. Pengambilan foto di&nbsp;<strong>Jembatan soka</strong>&nbsp;memang paling bagus saat siang dan sore hari.</p>\r\n\r\n<p><strong>Jembatan soka</strong>&nbsp;memang tergolong wisata baru yang membantu mendongkrak ekonomi warga sekitar. Awalnya memang hanya jembatan biasa yang menghubungkan Pundong dan Bantul, hingga akhirnya dijadikan tempat selfie karna latar belakang pegunungan yang menarik wisatawan. Jembatan soka juga merupakan tempat terbaik untuk mengabadikan sunset. Kamu bisa menunggu matahari terbenam sambil ngadem.</p>\r\n\r\n<h3><strong>Tiket masuk ke Jembatan Soka</strong></h3>\r\n\r\n<p>Berhubung lokasinya di tempat terbuka, maka&nbsp;<a href=\"https://widyalokawisata.com/jembatan-soka.html\"><strong>tiket masuk ke Jembatan Soka</strong></a>&nbsp;hanya sekedar kamu membayar parkir saja. Satu lagi yang bikin kita betah adalah banyaknya orang berjualan di sekitar lokasi sehingga tak perlu khawatir kelaperan. Meski banyak orang jualan disini, tapi kamu harus jaga kebersihan ya.</p>\r\n\r\n<p>https://widyalokawisata.com/jembatan-soka.html</p>\r\n', '1_21.jpg', '-7.976268', '110.343980'),
(22, 'Omah kuno miring', 'Jalan Kemasan, Perang Wedanan, Potorono, Banguntapan, Bantul, Daerah Istimewa Yogyakarta 55196', '<p>Sebuah rumah di Jalan Wonosari KM 8, Miyungan ini dibangun pada tahun 1952. Tak heran, bangunannya memang kental dengan suasana lawas. Berbekal ide untuk membuat spot foto dengan konsep Jawa Kuno, Bowo, pengelola Omah Kuno Miring menemui pemilik rumah untuk meminta ijin membuat spot foto unik ini. Spot foto satu ini berbeda dengan yang lain.</p>\r\n\r\n<p>Di hasil foto, kita akan terlihat seolah tidak terikat gravitasi. Menariknya lagi, setting foto adalah rumah khas masyarakat Jawa pada jaman dulu, lengkap dengan property dan kostum tradisional jawa. Paduan setting tempat dan benda-benda lawas yang &ldquo;diputar&rdquo; 45 derajat, pastinya akan membuat hasil foto unik dan lain dari yang lain. Namanya, Omah Kuno Miring.</p>\r\n\r\n<p>Untuk harga tiket yang ditawarkan yaitu</p>\r\n\r\n<ul>\r\n	<li>3 tahun ke bawah Gratis</li>\r\n	<li>Ulang Tahun : Gratis</li>\r\n	<li>Janda : Gratis</li>\r\n	<li>Pelajar mahasiswa : 10.000</li>\r\n	<li>Umum : 20.000</li>\r\n	<li>Duda : 40.000</li>\r\n</ul>\r\n\r\n<p>jadwal buka wisata ini yaitu</p>\r\n\r\n<ul>\r\n	<li>Senin - Jumat : 09.00 - 16.00 wib</li>\r\n	<li>Sabtu - Minggu : 09.00 - 19.00 wib</li>\r\n	<li>Pre Wedding : 06.00 - 09.00 wib</li>\r\n</ul>\r\n\r\n<p>Fasilitas yang ditawarkan yaitu Ruang spot Foto, Ruang tunggu di dalam dan luar, Mushola dan toilet dalam dan luar, Ruang Ibu menyusu, Ruang crew driver, Free costum dan property, Angkringan, Ruang ganti kostum, Parkir, Ada tujuh spot foto di Omah Kuno Miring, yang latar belakangnya adalah bagian-bagian sebuah rumah Jawa pada jaman dulu. Ada kamar tamu, kamar makan, lumbung tempat menyimpan hasil bumi, kamar tidur, raung tani, dapur, dan pengilon (kaca rias).</p>\r\n\r\n<p>Terdapat warung pesan makanan dan minuman. Ada bakmi, capcay, nasi goreng tetelan, teh, kopi, dan lain-lain dengan harga terjangkau, dari Rp 5000 sampai Rp 12.000</p>\r\n', '1_22.jpg', '-7.833131', '110.425240'),
(23, 'Curug pulosari', 'Sendangsari, Pajangan, Krebet, Sendangsari, Kec. Bantul, Bantul, Daerah Istimewa Yogyakarta 55751', '<p>Air Terjun atau Curug merupakan salah satu wisata alam yang diburu oleh para wisatawan yang ada di Jogja, sebuah kota yang nyata penuh kenangan. Ketika liburan dan akhir pekan adalah waktu yang tepat untuk serunya bermain air terjun. Curug Pulosari adalah curug yang terletak di Desa Wisata Krebet, yang secara administrasinya berada di Sendangsari, Kecamatan Pajangan, Kabupaten Bantul, DI. Yogyakarta. Jarak tempuhnya sekitar 20 km dari pusat kota Yogyakarta.</p>\r\n\r\n<p>Akses jalan menuju ke lokasi ini sudah baik dan beraspal, akan tetapi sebagian jalannya rusak dan berlumpur. Jika ditengok untuk menuju ke curug Pulosari ini dapat ditempuh dengan mudah dengan kendaraan roda dua. Dan bagi kendaraan roda empat harus ditempuh dengn berhati-hati. Untuk Anda yang menggunakan mobil harus berhati-hati, karena cukup sulit. Maka saran untuk emnuju ke lokasi lebih baik menggunakan kendaraan roda dua saja. Jika para pengunjung ingin melakukan pemacuan adrenalin bisa dengan climbing dan rappelling di air terjun Pulosari ini. Area untuk keduanya ini berada di barata ir terjun tepatnya berada di perbukitan.</p>\r\n\r\n<p>Selain itu, para wisatawan juga bisa melakukan kegiatan lain yang ditawarkan di lokasi yakni outbond dengan media air, memancing ikan dnegan tangan, memasukan air dengan botol berlubang, dan pastinya juga dengan berenang. Bahan baku kegiatan outbondnya bisa didapatkan dari warga sekitar mengingat desa ini juga merupakan desa wisata. Berbasah ria, bermain air, berenang, rappelng, climbing, juga sampai bisa foto pre-Wedding. Dengan cantikya air terjun ini banyak yang memanfaatkan untuk pemotretan foto model dan juga foto pre-wedding. Selain itu, curug Pulosari ini juga bisa dilakukan untuk studi banding. Akses menuju ke lokasi dari curug Banyunibo ini tinggal menyusur jalan setapak menuju pos Ronda kemudian ambil kiri hingga pertigaan dan setelah itu ikuti petunjuk jalan yang telah disediakan penduduk setempat.</p>\r\n\r\n<p>Tiket masuk ke lokasi sejauh ini belum ada tarif namun pengunjung bisa membayar parkir sejumlah Rp. 2.000. Fasilitas di curug Pulosari ini sudah cukup lengkap yakni sudah ada ruang ganti baju, ada sejumlah kios atau warung makanan dan minuman, tempat parkir, dan juga penyewaan ban untuk kalian yang tidak bisa berenang. Jika ingin menginap, di desa wisata Krebet ini sudah terdapat homestay yang bisa dijadikan lokasi bermalam. https://eksotisjogja.com/curug-pulosari-bantul-jogja/</p>\r\n', '1_23.jpg', '-7.860924', '110.287096'),
(25, 'Kampung edukasi Watu Lumbung ', 'Jl Panglima Sudirman, Parangtritis, Kretek, Kecamatan Kretek, Duwuran, Parangtritis, Kec. Kretek, Bantul, Yogyakarta 55772l ', '<p>Berawal dari usaha Muhammad Boy Rifai yang ingin memberdayakan masyarakat sekitar, area hutan jati ini pun diubah menjadi salah satu kawasan wisata alternatif yang menyatu dengan alam. Konstruksi-konstruksi dari bambu dan rumah-rumah sederhana berdinding kayu dibangun di antara pohon-pohon jati yang tumbuh tegak. Pohon-pohon jati yang tumbuh pun dimanfaatkan sebagai tiang-tiang penyangga konstruksi bambu.</p>\r\n\r\n<p>Di tempat inilah para pengunjung biasanya menghabiskan waktu menikmati keindahan pemandangan kawasan Parangtritis dari ketinggian. Tak hanya menyuguhkan panorama alam nan menawan, tempat wisata yang berjarak sekitar 4 kilometer dari Pantai Parangtritis ini juga menyelipkan nilai-nilai edukasi dengan cara unik dan asyik. Tak heran kita bisa menemukan perpustakaan sederhana di tempat ini.</p>\r\n\r\n<p>Beberapa &quot;ritual&quot; seperti menanam pohon, membaca buku minimal 25 menit, melayani sesama pengunjung serta membantu memasak di dapur adalah cara unik yang dikonsep untuk menanamkan nilai-nilai edukasi. Tak cukup itu, pengunjung juga bisa melakukan &quot;persembahan&quot; berupa 3 buku layak baca untuk perpustakaan. Semua ritual dan persembahan pun akan mendapatkan reward berupa makanan, minuman atau merchandise gratis.</p>\r\n\r\n<p>Mengunjungi Kampung Edukasi Watu Lumbung semakin syahdu di kala sore, saat matahari mulai bergeser ke arah barat dan sinarnya tak lagi terasa menyengat. Beberapa tempat kuliner unik seperti Lembayung, Kedai Wedangan, Kedai Susu, Pusat Sate Kiloan dan Alas Kuliner pun siap menyediakan makanan dan minuman khas ndeso sebagai teman untuk menikmati senja.</p>\r\n', '1_25.jpg', '-7.992380', '110.31777'),
(26, 'Balong water park', 'Jl. Pleret KM. 1,5, Potorono, Banjardadap, Potorono, Banguntapan, Bantul, Daerah Istimewa Yogyakarta 55194', '<p>Liburan ke waterpark di Yogyakarta adalah cara liburan bareng anak kecil yang tepat. Karena hampir semua anak-anak pasti suka bermain-main dengan air. Karena itu tidak ada salahnya jika kalian mengajak anak kecil untuk mampir dan berlibur ke wisata air ini. Di Balong Waterpark kalian bisa sambil mengajak mereka bermain air dan bersenang-senang. Balong Waterpark ini adalam taman bermain air pertama yang ada di Yogyakarta.</p>\r\n\r\n<p>Lokasinya berada tidak jauh dari pusat kota Yogyakarta, atau berada di sekitar perempatan ring road Kotagede ke arah timur sekitar 1,5 km. Balong Waterpark ini berada di Jalan Pleret km 1,5.</p>\r\n\r\n<p>Harga tiket masuk tiap pengunjung Balong Waterpark adalah&nbsp;IDR 15.000 per orang untuk hari Senin-Sabtu, dan IDR&nbsp;20.000 untuk hari Minggu dan hari libur. Sementara itu&nbsp;untuk anak di bawah 3 tahun, mereka tidak perlu membayar tiket untuk masuk ke waterpark ini, alias&nbsp;gratis. Jadi,&nbsp;tidak perlu mengeluarkan uang lebih jika membawan batita ke Balong Waterpark.</p>\r\n\r\n<p>Waterpark di Jogja yang pertama&nbsp;ini buka setiap hari mulai Jam&nbsp;10.00-18.00 WIB untuk hari Senin-Sabtu, dan buka pukul 08.00-18.00 WIB pada&nbsp;hari Minggu dan hari libur. O iya, perlu diketahui&nbsp;jika kalian membawa rombongan sejumlah&nbsp;20 orang atau lebih, maka kalian&nbsp;bisa meminta agar mendapatkan diskon khusus. Untuk diskon khusus di Balong Waterpark, mungkin kalian bisa&nbsp;menghubung kantor mereka pada&nbsp;nomor (0274) 443 5645.</p>\r\n', '1_26.jpg', '-7.843454', '110.410640');
